import React from 'react';
import '../pages/styles/profile.css';
import ProfileHeader from './ProfileHeader';
import ProfileTabs from './ProfileTabs';


const Middle = ({openModal}) =>{
    return(
        <div className='middle'>
            <ProfileHeader/>
            <ProfileTabs/>
        </div>
    )
}

export default Middle;
